import React from 'react';
import './DeleteBtn.css';

class DeleteBtn extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            label: 'Удалить'
        };
    }

    render() {
        return(
            <div>
                <button
                    className="deleteBtn">{this.state.label}
                </button>
            </div>
        )
    }
}

export default DeleteBtn;
